import React from 'react';
import AppLayout from '../components/AppLayout';
import { Row, Col } from 'antd';

const Home = () => {
    return (
        <AppLayout>
            <div>
            <Row gutter={[24, 16]}>
                <Col span={8} />
                <Col span={8} />
                <Col span={8} />
                <Col span={8} />
                <Col span={8} />
                <Col span={8} />
            </Row>
            <Row gutter={[24, 16]}>
                <Col span={8} />
                <Col span={8} />
                <Col span={8} />
            </Row>
            </div>
        </AppLayout>
    );
}

export default Home;
